function init()
	solids={[1]=true, [3]=true}
	gravity = 9.81 / 30
 friction = 5
 camerax = 0
 world_floor_height = 110
 game_running = false
 game_win = false
 draw_title = true
 title_tick = 0
 title_action_color = 0
 frame_count = 0
 game_score = 0
 score_count = 0
 music_started = false
	
	screen={}
		screen.width=128
		screen.heigh=128
	
	player={}
		player.width=2
		player.height=2
		player.x=(screen.width/2)-(player.width/2)
		player.y=world_floor_height
		player.vx=0
		player.vy=0
end

init()

function TIC()
	PLAYER_SPRITE=260
	spr(PLAYER_SPRITE, player.x, player.y, 0, 1, 0, 0, player.width, player.height)
end
